    false,nt"url": null,nt"notes": "This is the 1990 annual narrative report
    for Neal Smith National Wildlife Refuge (formerly Walnut Creek National Wildlife
    Refuge).  The refuge was established on September 1, 1990.  The report begins by
    covering the yearu2019s highlights and climatic conditions.  Land acquisition is
    discussed next, followed by refuge planning.  Administration is covered in the following
    section; a list of personnel is given as well as information about refuge funding.
     General public uses of the refuge are described, and a list of equipment that
    was purchased for the refuge is given.  Finally, cooperative programs are discussed.",nt"owner_org":
